import "./App.css";
import { PathSplitter } from "./PathSplitter";

function App() {
  const input =
    "M 25.5 224 h -1 l -0.1 -0.3 v -0.2 h 0.4 v -3.6 h -0.3 l -0.1 -0.3 v -0.2 L 26.4 219.4 a 2 2 0 0 1 1.6 0.6 c 0.4 0.4 0.6 1 0.6 1.7 l -0.2 1 l -0.5 0.7 l -0.7 0.5 a 3.5 3.5 0 0 1 -1.4 0.1 h -0.2 z";
  const color = "#393A3D";
  const white = "#FFFFFF";
  let last = "";
  let finalStr = "";
  PathSplitter(input).forEach((x) => {
    const curr = x.split(" ")[1];
    const finalColor = last === curr ? white : color;
    last = curr;
    finalStr += `
      <path
        android:pathData="${x}"
        android:fillColor="${finalColor}"/>
      `;
  });
  console.log(finalStr);
  return (
    <div className="App">
      <header className="App-header">
        Optimize SVG by splitting path data
      </header>
    </div>
  );
}

export default App;
